import React from 'react'
// Importing Bootstrap
import { Button } from 'reactstrap';


class Header extends React.Component {
  render() {
    return (
      <div className="header-title">
          <h1>
              <a className="title" href="#">GIT COMMANDS</a>
          </h1>
      </div>
    );
  }
}

export default Header;
